    <div className="App">
      <Card className="card">
        <Card.Title>
        <h1>
          USD Big Mac
        </h1>
        </Card.Title>
        <Card.Body>
      <h3>Start moving around the object art</h3>
      <h4>Click the AR scan to bring it to life</h4>
      <a href="#" class="btn btn-primary btn-lg active" role="button" aria-pressed="true">OpenSea</a>
        </Card.Body>
      </Card>
    </div>
  );
}
